import React from 'react';
import VideoEmbed from './DriveVideoEmbed.jsx';

function VideoSlider({videoList}) {
    return (
        <>
            {videoList.map((videoUrl, vertical) => (
                <DriveVideoEmbed
                    videoUrl={videoUrl}
                    vertical={vertical}
                />
            ))}
        </>
    );
}

export default VideoSlider;
